import React from 'react';
import { View,Text, Image, SafeAreaView } from 'react-native';
import logo from './assets/logoArvino.png';
import FCWineries from './FunctionalComponents/FCWineries';
import FCWines from './FunctionalComponents/FCWines';
import styleSheet from './Pages/PageStyle';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import MaterialTabPage from '../../../פיתוח אפליקציות/React_Clone1/B2020_2021/08 22-12-2020 Navigation/my-navigation-demo/Pages/MaterialTabPage';

function App() {
  const Tab = createBottomTabNavigator();

  function HomeScreen() {
    return (
      <View style={styleSheet.container}>
        <Image
          source={logo}
          style={styleSheet.logo}
        />
      <FCWineries />
      <FCWines />
      </View>
    );
  }

  function GroupsScreen() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Settings!</Text>
      </View>
    );
  }

  return (
    <SafeAreaView style={styleSheet.container}>
      <MaterialTabPage/>
    </SafeAreaView>

  );
}


export default App;
